const BaseHash = require("./BaseHashInterface");
const express = require('express');
const router = express.Router();
/***
 * base hash middle soft
 * Created by hvail on 2019/1/5.
 */
function middlerSoft() {
    return function BaseHashMiddle(key, field, cache) {
        new BaseHash(router, {cache: cache, key: key, field: field});
        return router;
    };
}

module.exports = middlerSoft;
